import React from "react";
import "../projects/Projects.css";
import "./community.css";
import { Fade } from "react-reveal";
export default function Community() {

  return (
    <Fade bottom duration={1000}>
      <div className="main" id="community">
        <div className="project-main-div">
          <div className="project-header">
            <h1 className="heading project-heading">Community Engagement</h1>
            <div>
            <p><b>Oct 2019</b>: Communications Lead @ <a target="_blank" rel="noopener noreferrer" href="https://groups.cs.umass.edu/voicesofds21/" className="no_decor">Voices of Data Science, University of Massachusetts Amherst</a></p>
            <p><b>Oct 2019</b>: <a target="_blank" rel="noopener noreferrer" href="https://yahoofinanceams2019.splashthat.com/" className="no_decor">Yahoo Finance All Markets Summit 2019: Generational Opportunities</a></p>
            <p><b>Oct 2018</b>: <a target="_blank" rel="noopener noreferrer" href="https://in.pycon.org/2018/" className="no_decor">PyCon India 2018</a></p>
            </div>
            </div>
          </div>
      </div>
    </Fade>
  );
}
